function generateBezierTrajectory(maxX) {
    // 控制点 - 基于示例数据估算
    const controlPoints = [
        {x: 0},    // 起始点
        {x: maxX / 4},   // 控制点1
        {x: maxX / 2},  // 控制点2
        {x: maxX}  // 结束点
    ];
    
    // 生成点的数量 - 基于示例数据长度
    const numPoints = 65;
    const trajectory = [[0, 0, 0]];
    
    // 时间间隔范围 - 基于示例数据估算
    const minTime = 2;
    const maxTime = 50;
    const avgTime = 7;
    
    for (let i = 0; i < numPoints; i++) {
        const t = i / (numPoints - 1);
        
        // 三次贝塞尔曲线公式
        const x = Math.round(
            Math.pow(1 - t, 3) * controlPoints[0].x +
            3 * Math.pow(1 - t, 2) * t * controlPoints[1].x +
            3 * (1 - t) * Math.pow(t, 2) * controlPoints[2].x +
            Math.pow(t, 3) * controlPoints[3].x
        );
        
        const y = 0;
        
        // 生成时间间隔 - 添加一些随机变化
        let timeInterval;
        if (i === 0) {
            timeInterval = 0;
        } else {
            // 基于平均时间间隔，添加一些随机变化
            timeInterval = Math.max(minTime, Math.min(maxTime, 
                avgTime + Math.floor(Math.random() * 5) - 2));
            
            // 偶尔生成异常值，像示例数据中那样
            if (Math.random() < 0.05) {
                timeInterval = Math.floor(Math.random() * 50) + 20;
            }
        }
        
        trajectory.push([x, y, timeInterval]);
    }
    
    return trajectory;
}

